import React, {Component} from 'react'
import './Home.css'


export default class Home extends Component{
	render(){

		return(
				<div className='Home'> 
					  <div class="hero-image">
				          <div class="hero-text">
				            <h1>I am John Doe</h1>
				            <p>And I'm a Photographer</p>
				            <button>Hire me</button>
				          </div>
				      </div>
				</div>
			)
	}
}
